import React from "react";
import { BrowserRouter as Router, Link, Route } from "react-router-dom";
import Products from "../DB/products.json";
import { Headphones } from "./Headphones";

export const Categories = props => {
  // const headphones = Products.HEADPHONES
  return (
    <Router>
      <div className="categories">
        <ul>
          <li>
            {" "}
            <Link to="/categories/headphones">Headphones</Link>{" "}
          </li>
          <li>
            {" "}
            <Link to="/phones">Phones</Link>{" "}
          </li>
          <li>
            {" "}
            <Link to="/laptops">Laptops</Link>{" "}
          </li>
        </ul>

        <Route
          path="/categories/headphones"
          render={() => (
            <Headphones
              // headphones={Products.HEADPHONES}
              brand={Products.HEADPHONES.map(function(item) {
                return (
                  <ul>
                    <li>{item.brand}</li>
                    <li>{item.name}</li>
                  </ul>
                );
              })}
              // name={Products.HEADPHONES.map(item => item.name)}
            />
          )}
        />
        {/* <Route path="/categories/headphones" component={Headphones}/> */}
      </div>
    </Router>
  );
};
